import React from "react";
import { Container, Col, Row, Button } from "react-bootstrap";

const productsArr = [
  {

    title: "Album 1",

    price: 100,

    imageUrl: "https://prasadyash2411.github.io/ecom-website/img/Album%201.png",
  },

  {
    title: "Album 2",

    price: 50,

    imageUrl: "https://prasadyash2411.github.io/ecom-website/img/Album%202.png",
  },

  {
    title: "Album 3",

    price: 70,

    imageUrl: "https://prasadyash2411.github.io/ecom-website/img/Album%203.png",
  },

  {
    title: "Album 4",

    price: 100,

    imageUrl: "https://prasadyash2411.github.io/ecom-website/img/Album%204.png",
  },
];
const ProductList = () => {
  return (
    <>
      <Container className="bg-red">
        <div>ProductList</div>
      </Container>

      <Container>
        <Row>
          <Col className="bg-red">
            <Col >{productsArr[0].title}</Col>
            <Col>
              {" "}
              <img src={productsArr[0].imageUrl} alt="Album1"></img>
            </Col>
            <Col>{productsArr[0].price}</Col>
            <Col>
              {" "}
              <Button variant="success">Cart</Button>
            </Col>
          </Col>

          <Col>
            <Col>{productsArr[1].title}</Col>
            <Col>
              {" "}
              <img src={productsArr[1].imageUrl} alt="Album1"></img>
            </Col>
            <Col>{productsArr[1].price}</Col>
            <Col>
              {" "}
              <Button variant="success">Cart</Button>
            </Col>
          </Col>
        </Row>
        <Row>
          <Col>
            <Col>{productsArr[2].title}</Col>
            <Col>
              {" "}
              <img src={productsArr[2].imageUrl} alt="Album1"></img>
            </Col>
            <Col>{productsArr[2].price}</Col>
            <Col>
              {" "}
              <Button variant="success">Cart</Button>
            </Col>
          </Col>

          <Col>
            <Col>{productsArr[3].title}</Col>
            <Col>
              {" "}
              <img src={productsArr[3].imageUrl} alt="Album1"></img>
            </Col>
            <Col>{productsArr[3].price}</Col>
            <Col>
              {" "}
              <Button variant="success">Cart</Button>
            </Col>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default ProductList;
